// Componente Raíz del proyecto
import React from "react";
import logo from './logo.svg';
import './App.css'; 

function App(){
    let estiloLogo = { // Objeto de JS  con propiedades CSS
        width: "10em",
        height: "10em"
    }
    return (
        <div className="App">
            <header className="App-header">
                <img src={ logo } style={ estiloLogo } className="App-logo"  alt="logo"/>
                <h1>Operaciones CRUD usuarios</h1>
            </header>
        </div>
    );
}
export default App;
